import React from 'react';
import './BottomBar.css';

function BottomBar() {
  return (
    <div className="BottomBar">
      <div className="Content">        
        <span>MeowMatrix-Tech</span>
        <img src="MMT.png" alt="M" />
      </div>
    </div>
  );
}

export default BottomBar;
